import styled from "styled-components";
export const ButtonElement = styled.button`
  background: #fff;
  border:none;
  padding: .5rem;
  font-size: 1rem;
  font-weight: 600
  outline:none;
  &:hover{
    background:  ${props => (props.navBtn ? "#fff" : "var(--mainBrown)")};
   color: ${props => (props.navBtn ? "none" : ".01rem solid #fff")};

  }
`;
